import { Link } from 'react-router-dom';

export default function NoPage() {
  return (
    <div className="container m-5">
      <h1>
        {"The page you are looking for does not exist"}
      </h1>
      <h4>
        <Link to="/">
          {"Take me back home"}
        </Link>
      </h4>
    </div>
  );
}
